import { Component } from '@angular/core';

@Component({
  selector: 'app-cab-presentacion',
  templateUrl: './cab-presentacion.component.html',
  styleUrls: ['./cab-presentacion.component.css']
})
export class CabPresentacionComponent {

}
<div class="content">
    <div class="logo">
        <h3>DIMSISTEM</h3>
    </div>
    <div class="titulo">
        <H2>SISTEMA GENERADOR DE TABLAS DE AMORTIZACIÓN DE CRÉDITOS</H2>
    </div>
    <div class="iconos">
        <i class="fa-regular fa-user"></i>
        <i class="fa-solid fa-bars"></i>
    </div>
</div>
